import React, { useState } from 'react';
import { useLocation,useSearchParams,createSearchParams  } from 'react-router-dom';

const DummyPaymentGateway = ({ onPaymentComplete }) => {
  const [paymentInProgress, setPaymentInProgress] = useState(false);
  const [paymentSuccess, setPaymentSuccess] = useState(false);
  const [paymentError, setPaymentError] = useState(false);
  const [searchparams]=useSearchParams();
  const [email, setEmail] = new URLSearchParams(window.location.search).get("name");
  const [cost,setCost]=new URLSearchParams(window.location.search).get("totalcost");
  const [quantity,setQuantity]=new URLSearchParams(window.location.search).get("quantity");
  const [product, setProduct]=new URLSearchParams(window.location.search).get("medicinename");
  const [Billing_Address, setAddress] = useState('');
  const [error, setError] = useState('');
  const handlePaymentSubmit = async (e) => {
    e.preventDefault();
    
  const formData = {
    email,
    cost,
  quantity,
product,
Billing_Address
  
};

try {
  const response = await fetch('http://127.0.0.1:8080/api/users/register', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(formData),
  });

  if (response.ok) {
    // Registration successful
    setPaymentInProgress(true);
    setTimeout(() => {
      const paymentSuccess = Math.random() < 0.8; // Simulate 80% success rate

      setPaymentInProgress(false);
      if (paymentSuccess) {
        setPaymentSuccess(true);
        onPaymentComplete(); // Invoke the callback function to handle payment completion
      } else {
        setPaymentError(true);
      }
    }, 2000); // Simulate a 2-second delay
  
    setEmail('');
    setProduct('');
    setAddress('');
    setCost('');
    setQuantity('');
    
    //setError('');
    // Add your desired logic here (e.g., redirect to login page)
  } else {
    const data = await response.json();
    throw new Error(data.message);
  }
} catch (error) {
  setError(error.message);
  console.log('Registration Error:', error);
}
};
}


  const handlePaymentSubmit = (e) => {
    e.preventDefault();
    

    // Simulate payment processing
    

    return (
      <div>
        <h1>Payment Page</h1>
        <form onSubmit={handlePaymentSubmit}>
          <div>
            <label>Product Name:</label>
            <input type="text" value={name} readOnly />
          </div>
          <div>
            <label>Total Cost:</label>
            <input type="number" value={totalCost} readOnly />
          </div>
          <div>
            <label>Quantity:</label>
            <input type="number" value={quantity} readOnly />
          </div>
          <div>
            <label>Card Number:</label>
            <input
              type="text"
              value={cardNumber}
              onChange={(e) => setCardNumber(e.target.value)}
            />
          </div>
          <div>
            <label>CVV:</label>
            <input
              type="text"
              value={cvv}
              onChange={(e) => setCvv(e.target.value)}
            />
          </div>
          <div>
            <label>Billing Address:</label>
            <input
              type="text"
              value={billingAddress}
              onChange={(e) => setAddress(e.target.value)}
            />
          </div>
          <button type="submit">Pay Now</button>
        </form>
      </div>
    );
  };
  
  export default DummyPaymentGateway;
